import React from 'react'
import Button from '@mui/material/Button'
import { showRenewHistory } from '../actions/actions'

const ButtonJ = () => {
    return (
        <div>
            <Button onClick={() => dispatchLocal(showRenewHistory([1, 1]))}>
                Показать историю
            </Button>
        </div>
    )
}

export default ButtonJ
